/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {

  let ss = Array.prototype.slice.call(s);
  let tt = Array.prototype.slice.call(t);

  for (const it of ss) {
    const index = tt.indexOf(it);
    tt.splice(index, 1);
  }
  return tt.join();

};

console.log(findTheDifference(s = "bacd", t = "abcde"));
